description:
Head First PMP covers everything you need to know to pass your PMP exam. The
sound-bite format combined with the whimsical images turns a dry subject into entertainment. The organization starts with the basics then drills into the details. The in-depth coverage of complex topics like Earned Value and Quality Control are presented in an easy to understand format with descriptions, pictures, and examples. This book will not only help you pass the PMP, it should be used as an daily
reference for practicing project managers


